import Layout from "../components/Layout";
import Link from 'next/link';

const Index = () => (
  <div>
    <Layout>
      <h1>메인페이지</h1>
      <h2><Link href="/about">
                <a style={{background: 'black', color: 'white'}}>소개</a>
            </Link></h2>
    </Layout>
  </div>
);

export default Index;
